import React from "react";
import { Link } from "react-router-dom";

const Shifting = () => {
    const renfun=(ab)=>{
        console.log(ab);
    }
  return (
    <div className="container-fluid" style={{ padding: "0 80px" }}>
      <div className="row">
      <div className="col-2" onClick={()=>renfun("cryp")}>
        CRYPTOCURRENCIES
      </div>
      <div className="col-1" onClick={()=>renfun("exch")}>
        Exchanges
      </div>
      <div className="col-1" onClick={()=>renfun("cryp")}>
        FAVORITES
      </div>
      <div className="col-1" onClick={()=>renfun("cryp")}>
        DEFI
      </div>
      <div className="col-1" onClick={()=>renfun("cryp")}>
        HEATMAP
      </div>
      </div>
    </div>
  );
};

export default Shifting;
